import React from 'react';
import {
  Flex,
  FormControl,
  InputGroup,
  InputLeftAddon,
  Input,
  Icon
} from '@chakra-ui/core'

function Home() {
  return (
    <Flex w="100vw" h="90vh" align="center" justify="center">
    <Form submit={context.handleLoginSubmit} title="Login">
      <FormControl isRequired>
        <InputGroup>
          <InputLeftAddon children={<Icon name="email" />} />
          <Input
            onChange={context.handleLoginInput}
            placeholder="Email"
            name="email"
            type="email"
            value={context.state.formLogin.email}
          />
        </InputGroup>
      </FormControl>
      <FormControl isRequired>
        <InputGroup>
          <InputLeftAddon children={<Icon name="lock" />} />
          <Input
            onChange={context.handleLoginInput}
            placeholder="Password"
            name="password"
            type="password"
            value={context.state.formLogin.password}
          />
        </InputGroup>
      </FormControl>
    </Form>
  </Flex>
  );
}

export default Home;
